import './App.css';
import Nav from '../src/Components/Nav';
import About from '../src/Components/About';
import Portfolio from './Components/Portfolio';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';



function App() {
  return (
    <Router>
      <div className="App">
        < Nav />
        <Route path="/" />
        < About />
        < Portfolio />
      </div>
    </Router>
  );
}

export default App;
